import React from './React';
import Carousel from './Carousel';

const Explore = () => {
    return (
      <div className="App">
        //In Theaters
        <Carousel endpoint='https://api.themoviedb.org/3/movie/now_playing?api_key=9512b36f031887e7c9ad226e2c26a6b2&language=en-US&page=1' />
      </div>
    );
} 

export default Explore;
